    "Assessment of mercury in Maineu2019s interior bald eagle population",nt"tracking_summary":
    {ntt"total": 8,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:48:53.618847",nt"name": "assessment-of-mercury-in-maines-interior-bald-eagle-population-8cd21",nt"isopen":
    false,nt"url": null,nt"notes": "High mercury burdens have been linked to
    negative effects on behavior, physiology, and fledging success in birds. In this
    study, mercury exposure and the potential for reproductive impacts in freshwater-feeding
    bald eagles (Haliaeetus leucocephalus) in Maine were investigated. Between 2001
    and 2006 (primarily 2004-2006), eaglet blood and shed adult feathers were collected
    from freshwater-based bald eagle nest territories throughout Maine. Tissues were
    analyzed for mercury to obtain insights on short-term and chronic exposure in eaglet
    and adult age classes, respectively. Nonviable and abandoned eggs were also collected
    and analyzed for mercury. Mercury patterns between habitats and among watersheds,
    relationships between mercury exposure and eagle productivity were evaluated. Temporal
    mercury trends were determined by comparing results in the present study to data
    collected in a previous U.S. Fish and Wildlife sponsored study (Welch 1994).",nt"license_title":
